import { useHistory } from "react-router";
import { Container, Col, Row } from "react-bootstrap";

const CardPopular = (props) => {
	const { name, image, id } = props.data;
	const history = useHistory();
	return (
		<>
			<Col xs={12} md={6} lg={3} className="mb-3">
				<Container>
					<Row
						className="bg-white py-3 "
						style={{ borderRadius: 5, cursor: "pointer", minHeight: "110px" }}
						onClick={() => {
							history.push(`/restaurant/${id}`);
						}}
					>
						<Col xs={3} className="text-center">
							<svg
								id="infinite-indicator"
								width="200"
								height="200"
								viewPort="0 0 100 100"
								version="1.1"
								xmlns="http://www.w3.org/2000/svg"
							>
								<circle
									r="40"
									cx="50"
									cy="50"
									style="fill:none; stroke: #ccc;stroke-width:10;stroke-opacity:0.6"
								></circle>
								<path
									d="M10 50 A40 40 0 1 1 90 50"
									style="fill:none; stroke: #ccc;stroke-width:10;"
								>
									<animateTransform
										attributeType="xml"
										attributeName="transform"
										type="rotate"
										from="0 50 50"
										to="360 50 50"
										dur="1s"
										repeatCount="indefinite"
									/>
								</path>
							</svg>
						</Col>
						<Col xs={9} className="my-auto text-center">
							<h5 className=" my-0 font-weight-bold ">{name}</h5>
						</Col>
					</Row>
				</Container>
			</Col>
		</>
	);
};

export default CardPopular;
